import React from 'react';
import MaterialIcon from 'material-icons-react';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { useCookies } from 'react-cookie';
import isAuth from '../functions/IsAuth';
import GetUserDetails from '../functions/GetUserDetails';
import '../css/New.css';
const HomeHeader = () => {
  const navigate = useNavigate();
  const [cookies, setCookie, removeCookie] = useCookies(['token']);
  const { userDetails } = GetUserDetails();

  const logout = () => {
    removeCookie('token');
    navigate('/login');
  };
  return (
    <>
      {userDetails ? (
        <>
          <div className="home-container">
            {' '}
            <div className="top">
              <header>
                <div className="nav-container">
                  <div className="left-nav">
                    <div className="search-container">
                      <MaterialIcon icon="search" />
                      <input
                        type="text"
                        placeholder="Search"
                        id="search-button"
                      />
                    </div>
                  </div>
                  <div className="middle-nav">
                    <div className="home">
                      <Link to="/">
                        <MaterialIcon icon="home" id="nav-icons" />{' '}
                      </Link>
                      <p>Home</p>
                    </div>
                    <div className="network">
                      <Link to="/">
                        <MaterialIcon icon="favorite" id="nav-icons" />
                      </Link>
                      <p>Favourites</p>
                    </div>
                    <div className="jobs">
                      <Link to="/">
                        <MaterialIcon icon="inventory_2" id="nav-icons" />
                      </Link>
                      <p>My Orders</p>
                    </div>
                    <div className="messaging">
                      <Link to="/mycart">
                        <MaterialIcon icon="shopping_cart" id="nav-icons" />
                      </Link>
                      <p>My Cart</p>
                    </div>
                    <div className="notifications">
                      <Link to="/">
                        <MaterialIcon icon="notifications" id="nav-icons" />
                      </Link>
                      <p>Notifications</p>
                    </div>
                    <div className="profile">
                      <MaterialIcon icon="person" id="nav-icons" />
                      <p>
                        {userDetails.username}
                        <MaterialIcon icon="arrow_drop_down" />
                      </p>
                      <div className="profile-dropdown">
                        <div className="profile-dropdown-content">
                          <Link to="/">Profile</Link>
                          <Link to="/">Settings</Link>
                          <p onClick={logout}>Logout</p>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </header>
            </div>
            <div className="bottom"></div>
          </div>
        </>
      ) : (
        <p>Loading user details...</p>
      )}
    </>
  );
};

export default HomeHeader;
